import React from "react";
import ReactDOM from "react-dom";
import Highcharts, { color } from 'highcharts';
import HighchartsReact from "highcharts-react-official";
import HighChartsMore from "highcharts/highcharts-more";
function DevopsChart() {
    HighChartsMore(Highcharts)
    let options= {
      // legend: {
      //   enabled:false
      // },
      // chart: {
      //   type: 'column',
      //   inverted: true,
      //   polar: true,
      //   height:"320px",
      //   backgroundColor:'transparent'
      // },
      // credits: {
      //   enabled:false
      // }
      chart: {
        type: 'item'
    },

    title: {
        text: 'Highcharts item chart'
    },

    subtitle: {
        text: 'Parliament visualization'
    },

    legend: {
        labelFormat: '{name} <span style="opacity: 0.4">{y}</span>'
    },

    series: [{
        name: 'Representatives',
        keys: ['name', 'y', 'color', 'label'],
        data: [
            ['The Left', 69, '#BE3075', 'DIE LINKE'],
            ['Social Democratic Party', 153, '#EB001F', 'SPD'],
            ['Alliance 90/The Greens', 67, '#64A12D', 'GRÜNE'],
            ['Free Democratic Party', 80, '#FFED00', 'FDP'],
            ['Christian Democratic Union', 200, '#000000', 'CDU'],
            ['Christian Social Union in Bavaria', 46, '#008AC5', 'CSU'],
            ['Alternative for Germany', 94, '#009EE0', 'AfD']
        ],
        dataLabels: {
            enabled: true,
            format: '{point.label}'
        },

        // Circular options
        center: ['50%', '88%'],
        size: '170%',
        startAngle: -100,
        endAngle: 100
    }]
    }


    return (
        <span>
      <HighchartsReact 
        highcharts={Highcharts}
        options={options}
      />
    </span>
    )
}

export default DevopsChart;

